import { SET_COUNT } from '../constants/pagination'

const initialState = {
    count: 0,
    work: false
}

export default function mini_dialog(state = initialState, action) {
    switch (action.type) {
        case SET_COUNT:
            return {...state, count: action.payload}
        default:
            return state
    }
}
